","iopub.execute_input":"2022-11-22T11:46:49.721829Z","iopub.status.idle":"2022-11-22T11:46:49.730916Z"},"trusted":true},"execution_count":4,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"0\"></a>\n<font color=\"black\" size=+2.5><b>Packages</b></font>\n**If it’s not already installed on your computer, you can use the install.packages function to install a package. \n\nA package is a collection of functions along with documentation, code, tests and example data.\n\ninstall.packages(\"tidyverse\")\n\nWe will see many functions in this tutorial. Functions are “canned scripts” that automate more complicated sets of commands. Many functions are predefined, or can be made available by importing R packages. A function usually takes one or more inputs called arguments. Here tidyverse is the argument to the install.packages() function.\n\n**Note: functions require parentheses after the function name.\n**\nGetting help\nTo see what any function in R does, type a ? before the name and help information will appear in the Help panel on the right in RStudio. Or you can search the function name in the Help panel search box. Google and Stack Overflow are also useful resources for getting help.\n\n?install.packages\n\nⓘ Tab completion\nA very useful feature is Tab completion. You can start typing and use Tab to autocomplete code, for example, a function name.\n\n# Common R errors\n\nR error messages are common and can sometimes be cryptic. You most likely will encounter at least one error message during this tutorial. Some common reasons for errors are:\n\nCase sensitivity. In R, as in other programming languages, case sensitivity is important. ?install.packages is different to ?Install.packages.\nMissing commas\nMismatched parentheses or brackets\nNot quoting file paths\nNot finishing a command so seeing “+” in the console. If you need to, you can press ESC to cancel the command.\nTo see examples of some R error messages with explanations see [here](https://github.com/noamross/zero-dependency-problems/issues/7)","metadata":{}},{"cell_type":"markdown","source":"<a id=\"0\"></a>\n<font color=\"black\" size=+2.5><b>Starters</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"code","source":"titanic=titanic[complete.cases(titanic),]","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2022-11-22T11:46:58.085935Z","iopub.execute_input":"2022-11-22T11:46:58.086816Z","iopub.status.idle":"2022-11-22T11:46:58.098169Z"},"trusted":true},"execution_count":5,"outputs":[]},{"cell_type":"markdown","source":"First, let's get a sense of the data's structure with the str() command.\n","metadata":{}},{"cell_type":"code","source":"str(titanic)","metadata":{"execution":{"iopub.status.busy":"2022-11-22T11:47:01.645231Z","iopub.execute_input":"2022-11-22T11:47:01.646371Z","iopub.status.idle":"2022-11-22T11:47:01.668294Z"},"trusted":true},"execution_count":6,"outputs":[{"name":"stdout","text":"tibble [183 × 12] (S3: tbl_df/tbl/data.frame)\n $ PassengerId: num [1:183] 2 4 7 11 12 22 24 28 53 55 ...\n $ Survived   : num [1:183] 1 1 0 1 1 1 1 0 1 0 ...\n $ Pclass     : num [1:183] 1 1 1 3 1 2 1 1 1 1 ...\n $ Name       : chr [1:183] \"Cumings, Mrs. John Bradley (Florence Briggs Thayer)\" \"Futrelle, Mrs. Jacques Heath (Lily May Peel)\" \"McCarthy, Mr. Timothy J\" \"Sandstrom, Miss. Marguerite Rut\" ...\n $ Sex        : chr [1:183] \"female\" \"female\" \"male\" \"female\" ...\n $ Age        : num [1:183] 38 35 54 4 58 34 28 19 49 65 ...\n $ SibSp      : num [1:183] 1 1 0 1 0 0 0 3 1 0 ...\n $ Parch      : num [1:183] 0 0 0 1 0 0 0 2 0 1 ...\n $ Ticket     : chr [1:183] \"PC 17599\" \"113803\" \"17463\" \"PP 9549\" ...\n $ Fare       : num [1:183] 71.3 53.1 51.9 16.7 26.6 ...\n $ Cabin      : chr [1:183] \"C85\" \"C123\" \"E46\" \"G6\