/a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** :  Relationship between numerical values exposing most data points by color gradient with jitter points and encircle dots based on condition.\n\n**Question** : How much relationship between Area and Price with respective to Lotshape of houses and encircle costlier houses?","metadata":{}},{"cell_type":"code","source":"costly_price_with_less_area<-house[house$SalePrice>600000 & house$LotArea<25000,]\n\nfig(12,8)\nggplot(house, aes(x=LotArea,y=SalePrice,color=LotShape)) +\n  geom_jitter(width = .5, size=2)+ # Adjusting size and width of points\n  geom_encircle(aes(x=LotArea, y=SalePrice), \n                data=costly_price_with_less_area, \n                color=\"red\", \n                size=2, \n                expand=0.08)+\n    labs(x=\"Area\",\n         y=\"Sales Price\", \n       title=\"Lot Area vs House Price (Circle Costlier House with Less Area) \")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"7\"></a>\n<font color=\"steelblue\" size=+2.5><b>7. Basic Bubble Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** :  Displays quantitative representation highlighting the most occured category with the size of bubble.\n\n**Question** : How much dependency between age and stay days of patients? Highlight the deposited amount in size","metadata":{}},{"cell_type":"code","source":"age1 <- data.frame(do.call('rbind', strsplit(as.character(health$Age),'-')))\nstay1<-data.frame(do.call('rbind', strsplit(as.character(health$Stay),'-')))\nhealth_df<-cbind(age1, stay1,health$Admission_Deposit,health$'Severity of Illness')\ncolnames(health_df) <- c(\"Age_Start\",\"Age_End\",\"Stay_Start\",\"Stay_End\",\"Deposit\",\"Severity\")\n\nhealth_df<-health_df[complete.cases(health_df),]\nhealth_df$Age_Start<-as.numeric(as.character(health_df$Age_Start))\nhealth_df$Age_End<-as.numeric(as.character(health_df$Age_End))\nhealth_df$Stay_Start<-as.numeric(as.character(health_df$Stay_Start))\nhealth_df$Stay_End<-as.numeric(as.character(health_df$Stay_End))\n\nhealth_df$age<-apply(health_df, 1, function(x) sample(seq(x[1], x[2]), 1))\nhealth_df<-health_df[complete.cases(health_df),]\nhealth_df$stay<-apply(health_df, 1, function(x) sample(seq(x[3], x[4]), 1))\n                     ","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(sample_n(health_df,100), aes(x=age,y=stay)) +\n  geom_jitter(aes(size=Deposit),color=\"blue\")+\n    labs(x=\"Age\",\n         y=\"Stay\", \n       title=\" Age vs Stay against Deposits\")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"8\"></a>\n<font color=\"steelblue\" size=+2.5><b>8. Bubble Plot with Color gradient</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** :  Displays quantitative representation highlighting the most occured category with the size of bubble and gradient.\n\n**Question** : How much dependency between age and stay days of patients? Highlight the deposited amount in size and number of stay days with color gradient","metadata":{}},{"cell_type"