_data)<-c('Genre','Count')","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(genre_data, aes(Genre,Count,fill=Count))+\ngeom_bar(stat=\"identity\", width = 0.5)+\ngeom_text(aes(label=Count), vjust=0) +\nscale_fill_gradient(low = \"green\", high = \"red\")+\n labs(x=\"Genre\",\n         y=\"Count\", \n       title=\"Distribution of Playstore Genres \")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15,angle=90),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"12\"></a>\n<font color=\"magenta\" size=+2.5><b>12. Bar chart - Stacked & Group</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation of a variable grouping/stacking the bars.\n\n**Question** : How many shows/movies were released in Netflix by India & United States over past 5 years? (Grouping or Stacking countries)","metadata":{}},{"cell_type":"code","source":"ind_us_shows<-netflix%>%filter( (country == \"United States\" | country == \"India\" )& release_year>2015)\n","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(ind_us_shows, aes(release_year,fill=country))+\ngeom_bar(stat=\"count\",position='stack', width = 0.5)+  # Stack for stacked chart\n labs(x=\"Year\",\n         y=\"Count\", \n       title=\"Distribution of Netflix Shows in India & US\")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15,angle=90),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(ind_us_shows, aes(release_year,fill=country))+\ngeom_bar(stat=\"count\", position='dodge',width = 0.5)+  # Dodge for group\n labs(x=\"Genre\",\n         y=\"Count\", \n       title=\"Distribution of Netflix Shows in India & US (Group) \")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15,angle=90),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"13\"></a>\n<font color=\"magenta\" size=+2.5><b>13. Facet Bar</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation of a variable with category in multiple charts\n\n**Question** : How many shows/movies were released in Netflix by India,US,UK & Australia over past 5 years? (Facet)","metadata":{}},{"cell_type":"code","source":"four_shows<-netflix%>%filter( (country == \"United States\" | country == \"India\"  | country=='United Kingdom'|country =='Australia')& release_year>2015)","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(four_shows, aes(release_year))+\ngeom_bar(stat=\"count\", width = 0.5,aes(fill=country))+\n labs(x=\"Genre\",\n         y=\"Count\", \n       title=\"Distribution of Netflix Shows in India,US,UK & Australia \")+ \nfacet_wrap(~country)+\ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15,angle=90),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"14\"></a>\n<font color=\"magenta\" size=+2.5><b>14. Horizontal Bar</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation of a variable in a horizontal manner.\n\n**Question** : How many hospitals fall in each type?","metadata":{}},{"cell_type":"code","source":"hosp_code<-as.data.frame(table(health$Hospital_type_code))\ncolnames(hosp_code)<-c('hospital_code','count')","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(hosp_code, aes(x=hospital_code,y=count))+\ngeom_bar(stat=\"identity\",width = 0.5,aes(fill=count))+ \nscale_fill_gradient(low = \"red\", high = \"blue\")+\ncoord_flip()+\n labs(x=\"Hospital Code\",\n         y=\"Count\", \n       title=\"Distribution of Hospital Type Code\")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),axis.text.x= element_text(size=15,angle=90),\n                            axis.text.y= element_text(size=15), axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"15\"></a>\n<font color=\"crimson\" size=+2.5><b>15. Dot Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation of a variable with dot.\n\n**Question** : How many covid deaths were found in top countries?","metadata":{}},{"cell_type":"code","source":"total_death<-as.data.frame(aggregate(covid$Deaths, by=list(country=covid$'Country/Region'), FUN=sum))\ncolnames(total_death)<-c('country','deaths')\ntotal_death<-total_death[order(-total_death$deaths),]%>%top_n(10)","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(total_death, aes(x=country, y=deaths)) + \n  geom_point(col=\"blue\", size=5) +   # Draw points\n  geom_segment(aes(x=country, \n                   xend=country, \n                   y=min(deaths), \n                   yend=max(deaths)), \n               linetype=\"dashed\", \n               size=0.1) +   # Draw dashed lines\n labs(x=\"Country\",\n         y=\"Number of COVID Deaths\", \n       title=\"Distribution of Deaths across countries \")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),\n      axis.text.x= element_text(size=15),\n    axis.text.y= element_text(size=15), \n      axis.title=element_text(size=18))+\ncoord_flip()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"16\"></a>\n<font color=\"crimson\" size=+2.5><b>16. Lollipop Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation of a variable with lollipop.\n\n**Question** : How many people were killed on each race by US police?","metadata":{}},{"cell_type":"code","source":"race_df<-as.data.frame(table(police$race))\ncolnames(race_df)<-c('race','count')","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(race_df, aes(x=race, y=count)) + \n  geom_point(size=5) + \n  geom_segment(aes(x=race, \n                   xend=race, \n                   y=0, \n                   yend=count)) + \n labs(x=\"Race\",\n         y=\"Number of Victims\", \n       title=\"Distribution of US Victims of each Race\")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22),\n      axis.text.x= element_text(size=15),\n      axis.text.y= element_text(size=15), \n      axis.title=element_text(size=18))\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"17\"></a>\n<font color=\"crimson\" size=+2.5><b>17. Ordered Bar Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation of a variable with ordered bar/rank.\n\n**Question** : How many people were killed on each race by US police?","metadata":{}},{"cell_type":"code","source":"race_df <- race_df[order(race_df$count), ]  # sort\nrace_df$race <- factor(race_df$race, levels = race_df$race) \n\nfig(12,8)\nggplot(race_df, aes(x=race, y=count)) + \n  geom_bar(stat=\"identity\", width=.5, fill=\"darkblue\") + \n  labs(x=\"Race\",\n         y=\"Number of Victims\", \n       title=\"Distribution of US Victims of each race\")+ \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"18\"></a>\n<font color=\"crimson\" size=+2.5><b>18. Slope Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Compare positional placements between 2 points on time\n\n**Question** : What is average close and open price of bank stocks recorded on 2019?(If open price is higher than close,then green else red )","metadata":{}},{"cell_type":"code","source":"axis$year<-format(as.Date(axis$Date, format=\"%Y-%m-%d\"),\"%Y\")\nhdfc$year<-format(as.Date(hdfc$Date, format=\"%Y-%m-%d\"),\"%Y\")\nindus$year<-format(as.Date(indus$Date, format=\"%Y-%m-%d\"),\"%Y\")\nkotak$year<-format(as.Date(kotak$Date, format=\"%Y-%m-%d\"),\"%Y\")\nicici$year<-format(as.Date(icici$Date, format=\"%Y-%m-%d\"),\"%Y\")\n\nici<-aggregate(list(icici[icici$year==2019,]$Open,icici[icici$year==2019,]$Close), by=list(year=icici[icici$year==2019,]$year), FUN=mean)\nici$name='icici'\ncolnames(ici)<-c('year','open','close','name')\n\naxi<-aggregate(list(axis[axis$year==2019,]$Open,axis[axis$year==2019,]$Close), by=list(year=axis[axis$year==2019,]$year), FUN=mean)\naxi$name='axis'\ncolnames(axi)<-c('year','open','close','name')\n\nhdf<-aggregate(list(hdfc[hdfc$year==2019,]$Open,hdfc[hdfc$year==2019,]$Close), by=list(year=hdfc[hdfc$year==2019,]$year), FUN=mean)\nhdf$name='hdfc'\ncolnames(hdf)<-c('year','open','close','name')\n\nkot<-aggregate(list(kotak[kotak$year==2019,]$Open,kotak[kotak$year==2019,]$Close), by=list(year=kotak[kotak$year==2019,]$year), FUN=mean)\nkot$name='kotak'\ncolnames(kot)<-c('year','open','close','name')\n\nind<-aggregate(list(indus[indus$year==2019,]$Open,indus[indus$year==2019,]$Close), by=list(year=indus[indus$year==2019,]$year), FUN=mean)\nind$name='indus'\ncolnames(ind)<-c('year','open','close','name')\n\nbank_stock<-rbind(ici,axi,hdf,kot,ind)\n\nleft_label <- paste(bank_stock$name, round(bank_stock$open,2),sep=\", \")\nright_label <- paste(bank_stock$name, round(bank_stock$close,2),sep=\", \")\nbank_stock$class <- ifelse((bank_stock$open - bank_stock$close) < 0, \"red\", \"green\")","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\np<-ggplot(bank_stock) + geom_segment(aes(x=1, xend=2, y=open, yend=close, col=class), size=.75, show.legend=F) + \n                  geom_vline(xintercept=1, linetype=\"dashed\", size=.1) + \n                  geom_vline(xintercept=2, linetype=\"dashed\", size=.1) +\n                  scale_color_manual(labels = c(\"Up\", \"Down\"), \n                                     values = c(\"green\"=\"#00ba38\", \"red\"=\"#f8766d\")) +  # color of lines\n                  labs(x=\" \",\n             y=\"Average Price\", \n               title=\"Average Open & Close price of Bank Stocks in 2019\")+    # Axis labels\n                  xlim(.5, 2.5) + ylim(0,(1.1*(max(bank_stock$open, bank_stock$close))))  # X and Y axis limits\n\n# Add texts\np <- p + geom_text(label=left_label, y=bank_stock$open, x=rep(1, NROW(df)), hjust=1.1, size=5)\np <- p + geom_text(label=right_label, y=bank_stock$close, x=rep(2, NROW(df)), hjust=-0.1, size=5)\np <- p + geom_text(label=\"Open Price\", x=1, y=1.1*(max(bank_stock$open, bank_stock$close)), hjust=1.2, size=5)  # title\np <- p + geom_text(label=\"Close Price\", x=2, y=1.1*(max(bank_stock$open, bank_stock$close)), hjust=-0.1, size=5)  # title\n\n# Minify theme\np + theme_bw()+\n    theme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"19\"></a>\n<font color=\"crimson\" size=+2.5><b>19. Dumbbell Chart</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : 1. Visualize relative positions (like growth and decline) between two points in time. 2. Compare distance between two categories.\n\n**Question** : How many people died and recovered so far from covid across countries?(Display both in dumbbell shape)","metadata":{}},{"cell_type":"code","source":"covid_death<-aggregate(list(covid$Deaths,covid$Recovered), by=list(country=covid$'Country/Region'), FUN=sum)\ncolnames(covid_death)<-c('country','deaths','recovered')\ncovid_death=covid_death[-covid_death$recovered,]%>%top_n(10)\ncovid_death$country <- factor(covid_death$country, levels=as.character(covid_death$country))","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(covid_death, aes(x=deaths, xend=recovered, y=country, group=country)) + \n        geom_dumbbell(color=\"#a3c4dc\", \n                      size=0.75,\n                      colour_x =\"red\",\n                     colour_xend=\"darkblue\",\n                     size_x = 2.5,\n              size_xend = 2.5) + \n         labs(x=\"\",\n         y=\"\", \n       title=\"Deaths and Recovered Cases over countries\")+\n    theme_bw()+\n    theme(plot.title = element_text(size=22)\n     ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"20\"></a>\n<font color=\"green\" size=+2.5><b>20. Pie Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation in pie with label and textinfo.\n\n**Question** : What is split distribution count of netflix program types?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\npie <- ggplot(netflix, aes(x = \"\", fill = factor(type))) + \n  geom_bar(width = 1) +\n  theme(axis.line = element_blank(), \n        plot.title = element_text(hjust=0.5,size=22)) + \n  labs(fill=\"class\", \n       x=NULL, \n       y=NULL, \n       title=\"Pie Chart of Netflix shows \")\n  \npie + coord_polar(theta = \"y\", start=0)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"21\"></a>\n<font color=\"green\" size=+2.5><b>21. Color Pie</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation in pie with custom colors to labels\n\n**Question** : What is split distribution count of severity of patients in hospital? Highlight each category with different color","metadata":{}},{"cell_type":"code","source":"severity_df<-as.data.frame(table(health$'Severity of Illness'))\ncolnames(severity_df)<-c('severity','patients')","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"custom_col <- c(\"red\", \"green\", \"orange\") \n\nfig(12,8)                   \nggplot(severity_df, aes(x = \"\", y=patients, fill = factor(severity))) + \n  geom_bar(width = 1, stat = \"identity\") +\n  theme(axis.line = element_blank(), \n        plot.title = element_text(hjust=0.5,size=22)) + \n  labs(fill=\"severity\", \n       x=NULL, \n       y=NULL, \n       title=\"Pie Chart of patient severeness\") + coord_polar(theta = \"y\", start=0)+\nscale_fill_manual(values=custom_col)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"22\"></a>\n<font color=\"green\" size=+2.5><b>22. Customized Pie- Gradient & Text</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation in pie with custom colors to labels\n\n**Question** : What is split distribution count of severity of patients in hospital? Highlight each category with gradient and text","metadata":{}},{"cell_type":"code","source":"fig(12,8)                   \nggplot(severity_df, aes(x = \"\", y=patients, fill = severity)) + \n  geom_bar(width = 1, stat = \"identity\") +coord_polar(theta = \"y\", start=0)+\nscale_fill_brewer(palette=\"Blues\")+\n  labs(fill=\"Severity\", \n       x=NULL, \n       y=NULL, \n       title=\"Pie Chart of patient severeness \") + \ngeom_text(aes(label = patients),size=8, position = position_stack(vjust = 0.5))+\ntheme_void()+theme(plot.title = element_text(hjust=0.5,size=22)) ","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"23\"></a>\n<font color=\"green\" size=+2.5><b>23. Donut Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation in pie with donut shape.\n\n**Question** : What is distribution count of google playstore apps content rating?","metadata":{}},{"cell_type":"code","source":"content_df<-as.data.frame(table(playstore$'Content Rating'))\ncolnames(content_df)<-c('content','count')","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# Compute percentages\ncontent_df$fraction <- content_df$count / sum(content_df$count)\n\n# Compute the cumulative percentages (top of each rectangle)\ncontent_df$ymax <- cumsum(content_df$fraction)\n\n# Compute the bottom of each rectangle\ncontent_df$ymin <- c(0, head(content_df$ymax, n=-1))\n\n# Compute label position\ncontent_df$labelPosition <- (content_df$ymax + content_df$ymin) / 2\n\n# Compute a good label\ncontent_df$label <- paste0(content_df$content, \"\\n value: \", content_df$count)\n\n# Make the plot\nfig(12,8)  \n\nggplot(content_df, aes(ymax=ymax, ymin=ymin, xmax=4, xmin=3, fill=content)) +\n  geom_rect() +\n  geom_label( x=3.5, aes(y=labelPosition, label=label), size=6) +\n  scale_fill_brewer(palette=7) +\n  coord_polar(theta=\"y\") +\n  xlim(c(2, 4)) +\n   labs(fill='content', \n       x=NULL, \n       y=NULL, \n       title=\"Distribution of Playstore Content Ratings \")+\n  theme_void() +\n  theme(legend.position = \"none\")+theme(plot.title = element_text(hjust=0.5,size=22)) \n\n# Reference - https://www.r-graph-gallery.com/128-ring-or-donut-plot","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"24\"></a>\n<font color=\"green\" size=+2.5><b>24. Ring Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Displays quantitative representation in pie with ring shape.\n\n**Question** : What is distribution count of google playstore apps content rating?","metadata":{}},{"cell_type":"code","source":"fig(12,8)  \nggplot(content_df, aes(ymax=ymax, ymin=ymin, xmax=4, xmin=3, fill=content)) +\n  geom_rect() +\n  geom_text( x=2, aes(y=labelPosition, label=label), size=4) + # x here controls label position (inner / outer)\n  #scale_fill_brewer(palette=3) +\n  scale_color_brewer(palette=3) +\n  coord_polar(theta=\"y\") +\n  xlim(c(-1, 4)) +\n  labs( x=NULL, \n       y=NULL, \n       title=\"Distribution of Playstore Content Ratings\")+\n  theme_void() +\n  theme(legend.position = \"none\")+theme(plot.title = element_text(hjust=0.5,size=22)) ","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"25\"></a>\n<font color=\"darkblue\" size=+2.5><b>25. Basic Time Series</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">