ss\",\n         y=\"Age\", \n     fill=\"Gender\",\n       title=\"Distribution of Titanic Passengers Age from different class\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"32\"></a>\n<font color=\"brown\" size=+2.5><b>32. Customized - Box Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continuous variable for different categories.\n\n**Question** : How were the age spread for passengers travelled in different classes with respect to gender in Titanic?(Customized color & Legend positions)","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(titanic, aes(factor(Pclass), Age)) + \ngeom_boxplot(aes(fill=factor(Sex))) +\nlabs(x=\"Pclass\",\n         y=\"Age\", \n     fill=\"Gender\",\n       title=\"Distribution of Titanic Passengers Age from different Class\")+ \nscale_fill_brewer(palette=\"Dark2\")+  # Custom theme\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18),\n     legend.position=\"bottom\") +   # change legend position\n scale_x_discrete(limits=c(\"2\", \"3\", \"1\"))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"33\"></a>\n<font color=\"brown\" size=+2.5><b>33. Box & Dot Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continuous variable for different categories.\n\n**Question** : How were the age spread for passengers travelled in titanic with respect to gender?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(titanic, aes(factor(Sex), Age)) + \ngeom_boxplot(aes(fill=factor(Sex))) +\n geom_dotplot(binaxis='y', \n               stackdir='center', \n               dotsize = .5, \n               fill=\"red\") +\nlabs(x=\"Gender\",\n         y=\"Age\", \n     fill=\"Gender\",\n       title=\"Distribution of Titanic Passengers Age from different Gender\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"34\"></a>\n<font color=\"brown\" size=+2.5><b>34. Tufte Boxplot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Tufte box plot, provided by ggthemes package is inspired by the works of Edward Tufte. Tufte’s Box plot is just a box plot made minimal and visually appealing.\n\n**Question** : How are house prices distributed among different sales conditions?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(house, aes(SaleCondition, SalePrice))+\ngeom_tufteboxplot() +\nlabs(x=\"Sales Condition\",\n         y=\"Price\", \n       title=\"Distribution of House Prices for different Sales Condition\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"35\"></a>\n<font color=\"olive\" size=+2.5><b>35. Basic Histogram</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continous variable.\n\n**Question** : What is the salary distribution of Computer management graduates?","metadata":{}},{"cell_type":"code","source":"com_df<-campus%>%filter(degree_t=='Comm&Mgmt')\ncom_df<-com_df[complete.cases(com_df), ]","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(com_df, aes(x=salary)) + \ngeom_histogram(binwidth=10000,fill=\"magenta\")+\nlabs(x=\"Salary\",\n         y=\"Count\", \n       title=\"Distribution of Salaries for Comm&Mgmt\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"36\"></a>\n<font color=\"olive\" size=+2.5><b>36. Histogram Stacked</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continous variable for multiple categories.\n\n**Question** : What is the salary distribution of candidates with different specialisations?","metadata":{}},{"cell_type":"code","source":"campus<-campus[complete.cases(campus), ]","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(campus, aes(x=salary, color=specialisation,fill=specialisation)) +\n  geom_histogram(alpha=0.2,position=\"identity\",binwidth=10000)+\nlabs(x=\"Salary\",\n         y=\"Count\", \n       title=\"Distribution of Salaries for different Specialisation\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"37\"></a>\n<font color=\"olive\" size=+2.5><b>37. Histogram - Mean & Line type</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continous variable with mean line\n\n**Question** : What is the distribution of open price of CIPLA stock?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(cipla, aes(x=Open)) + \ngeom_histogram(binwidth=50,fill=\"lightblue\",linetype=\"dashed\",color=\"black\",size=2)+\ngeom_vline(aes(xintercept=mean(Open)),\n            color=\"blue\", linetype=\"dashed\", size=2)+\nlabs(x=\"Open Price\",\n         y=\"Count\", \n       title=\"Distribution of CIPLA Open Price\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"38\"></a>\n<font color=\"olive\" size=+2.5><b>38. Facet Histogram</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continous variable with facet\n\n**Question** : What is the distribution of open price of pharma stocks?","metadata":{}},{"cell_type":"code","source":"med_stock<-nifty%>%filter(Symbol=='CIPLA'|Symbol=='DRREDDY'|Symbol=='SUNPHARMA')","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(med_stock, aes(x=Open)) + \ngeom_histogram(binwidth=50,aes(fill=Symbol))+\nfacet_grid(Symbol ~ .)+\nlabs(x=\"Open Price\",\n         y=\"Count\", \n       title=\"Distribution of Pharma Stocks Open Price\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"39\"></a>\n<font color=\"orange\" size=+2.5><b>39. Basic Density Plot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display distribution of a continous variable with density\n\n**Question** : What is the distribution of victims over all states in US?","metadata":{}},{"cell_type":"code","source":"police$state<-as.factor(police$state)\ndeath_by_state<-count(police$state)","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(death_by_state, aes(x=freq))+\n  geom_density(color=\"darkblue\", fill=\"lightblue\",alpha=0.7)+\nlabs(x=\"Deaths Per State\",\n         y=\"Count\", \n       title=\"Distribution of Victims in United States\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cel