 color=\"violet\" size=+2.5><b>47. Violin - Mean & SD</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display the distribution of a continous variable in violin plot with mean & SD\n\n**Question** : How much spread does the house sales price have for different Lotshape?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(house, aes(x=LotShape, y=SalePrice)) + \n  geom_violin(trim=FALSE)+\nlabs(x=\"\",\n         y=\"Sales Price\", \n       title=\"Distribution of House Sales Prices for LotShape\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))+\nstat_summary(fun.data=mean_sdl, \n                 geom=\"pointrange\", color=\"red\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"48\"></a>\n<font color=\"violet\" size=+2.5><b>48. Violin - Boxplot</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display the distribution of a continous variable in violin plot with boxplot\n\n**Question** : How much spread does the house sales price have for different Lotshape?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(house, aes(x=LotShape, y=SalePrice,fill=LotShape)) + \n  geom_violin()+\ngeom_boxplot(width=0.1)+\nlabs(x=\"\",\n         y=\"Sales Price\", \n       title=\"Distribution of House Sales Prices for LotShape\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=1