g age and stay of patients?","metadata":{}},{"cell_type":"code","source":"ggplot(sample_n(health_df,1000), aes(age, stay)) + \ngeom_count(col=\"tomato3\", show.legend=T)+\nlabs(x=\"Age\",\n     y=\"Stay\", \n     title=\"Distribution of Age & Stay Days\")+  \ntheme_set(theme_bw()) +\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"59\"></a>\n<font color=\"darkpink\" size=+2.5><b>59. Pyramid</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(cipla_monthly, aes(date, returns_percent)) + \n  geom_area() + \n  theme(axis.text.x = element_text(angle=90)) + \nlabs(y=\"% Returns for CIPLA Close Price\",\n         x=\"Date\", \n       title=\"Area Chart - CIPLA price (Normalized)\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=18)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"64\"></a>\n<font color=\"blue\" size=+2.5><b>64. Basic Heatmap</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display heatmap of quantitative variables with a numerical variable as dense\n\n**Question** : How are the admission deposit amount varied for all patients with different Age and Stay Days?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(sample_n(health,30000), aes(Age,Stay , fill=Admission_Deposit)) + \n  geom_tile()+\nlabs(y=\"Stay\",\n         x=\"Age\", \n       title=\"Distribution of Age & Stay with Admission Deposit)\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"65\"></a>\n<font color=\"blue\" size=+2.5><b>65. Heatmap Color</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display heatmap of quantitative variables with a numerical variable as dense (Different color)\n\n**Question** : How are the admission deposit amount varied for all patients with different Age and Stay Days?","metadata":{}},{"cell_type":"code","source":"fig(12,8)\nggplot(sample_n(health,30000), aes(Age,Stay , fill=Admission_Deposit)) + \n  geom_tile()+\nscale_fill_distiller(palette = \"RdPu\") +\nlabs(y=\"Stay\",\n         x=\"Age\", \n       title=\"Distribution of Age & Stay with Admission Deposit)\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"66\"></a>\n<font color=\"blue\" size=+2.5><b>66. Correlation Heatmap</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display heatmap of correlation matrix of numerical variables\n\n**Question** : How much are the delhi house dataset variables related to each other?","metadata":{}},{"cell_type":"code","source":"delhi_cor_df <- delhi_house[, c('Price','Area','No. of Bedrooms','Resale','BED')]\ncormat_delhi <- round(cor(delhi_cor_df),2)\nmelted_cormat_delhi <- melt(cormat_delhi)","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(data = melted_cormat_delhi, aes(x=Var1, y=Var2, fill=value)) + \n  geom_tile()+\nlabs(y=\"\",\n         x=\"\", \n       title=\"Heatmap of House Elements\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"67\"></a>\n<font color=\"blue\" size=+2.5><b>67. Correlation Triangle Heatmap</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display heatmap of correlation matrix of numerical variables with different color\n\n**Question** : How much are the delhi house dataset variables related to each other?","metadata":{}},{"cell_type":"code","source":"# Get lower triangle of the correlation matrix\n  get_lower_tri<-function(cormat){\n    cormat[upper.tri(cormat)] <- NA\n    return(cormat)\n  }\n  # Get upper triangle of the correlation matrix\n  get_upper_tri <- function(cormat){\n    cormat[lower.tri(cormat)]<- NA\n    return(cormat)\n  }","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"upper_tri_delhi <- get_upper_tri(cormat_delhi)\nmelted_cormat_delhi <- melt(upper_tri_delhi, na.rm = TRUE)","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"ggplot(data = melted_cormat_delhi, aes(Var2, Var1, fill = value))+\n geom_tile(color = \"white\")+\n scale_fill_gradient2(low = \"blue\", high = \"red\", mid = \"white\", \n   midpoint = 0, limit = c(-1,1), space = \"Lab\", \n   name=\"Pearson\\nCorrelation\") +\n  theme_minimal()+ \n theme(axis.text.x = element_text(angle = 45, vjust = 1, \n    size = 12, hjust = 1))+\n coord_fixed()+\nlabs(y=\"\",\n         x=\"\", \n       title=\"Triangle Heatmap of House Elements\")+  \ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"68\"></a>\n<font color=\"blue\" size=+2.5><b>68. Calendar Heatmap</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display heatmap of daily time series values\n\n**Question** : How dense are the ITC Open price from 2016 to 2020? ","metadata":{}},{"cell_type":"code","source":"itc$year<-as.numeric(format(as.Date(itc$Date),\"%Y\"))\n#Create Month Week\nitc_df<-itc%>%filter(year>2015)\nitc_df$yearmonth <- as.yearmon(itc_df$Date)\nitc_df$yearmonthf <- factor(itc_df$yearmonth)\n\nitc_df$week<-as.numeric(strftime(itc_df$Date, format = \"%V\"))\nitc_df$month<-as.factor(strftime(itc_df$Date, format = \"%B\"))\nitc_df$weekdayf<-as.factor(weekdays(itc_df$Date))\nitc_df$monthweek<-ceiling(day(itc_df$Date) /7 )     ## 8th day of the current month\nitc_df<-itc_df%>%filter(weekdayf!='Sunday'& weekdayf!='Saturday')\nitc_df$month = factor(itc_df$month, \n                                      levels=c('January','February','March',\n                                               'April','May','June','July',\n                                               'August','September','October',\n                                               'November','December'))","metadata":{"_kg_hide-input":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"fig(12,8)\nggplot(itc_df, aes(monthweek, weekdayf, fill = Open)) + \n  geom_tile(colour = \"white\") + \n  facet_grid(year~month) + \n  scale_fill_gradient(low=\"red\", high=\"green\") +\n  labs(x=\"Week of Month\",\n       y=\"\",\n       title = \"Time-Series Calendar Heatmap - ITC Open Price\", \n       fill=\"Open Price\")+\ntheme_bw()+\ntheme(plot.title = element_text(size=22)\n      ,axis.text.x= element_text(size=15),\n       axis.text.y= element_text(size=15),\n        axis.title=element_text(size=18))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"69\"></a>\n<font color=\"blueviolet\" size=+2.5><b>69. Choropleth - World</b></font>\n\n<a href=\"#top\" class=\"btn btn-primary btn-sm\" role=\"button\" aria-pressed=\"true\" style=\"color:white\" data-toggle=\"popover\" title=\"go to Colors\">Go to TOC</a>","metadata":{}},{"cell_type":"markdown","source":"**Purpose** : Display heatmap by count\n\n**Question** : How much dense are the covid death victims across the world?","metadata":{}},{"cell_type":"code","source":"covid$region<- ifelse(covid$country=='Mainland China','China', covid$country)\ncovid$region<- ifelse(covid$country=='US','USA', covid$country)\ncovid_world_deaths<-covid%>%group_by(region)%>%summarise(total=sum(Deaths))\n\nworld_data<-map_data('world')\nworld_deaths_map <- left_join(world_data, covid_world_deaths, by = \"region\")","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"\n# Create the map\nfig(12,8)\nggplot(world_deaths_map, aes(long, lat, group = group))+\n  geom_polygon(aes(fill = total), color = \"white\")+\n